import React from "react";
// import './index.css';
import Heading from './Heading';
import Para from './Para';
import Orderlist from './Orderlist';
import GoodMorning from './GoodMorning';
import Evening from './Evening';
import Afternoon from './Afternoon';

function App(){
    return(
     <>
        <Heading/>
        <Para/>
        <Orderlist/>
        <GoodMorning/>
        <Evening/>
        <Afternoon/>
    </>  
        );
     
}
export default App;
